import React from 'react';
import styled from 'styled-components';

const BannerRoot = styled.div`
  display: flex;
  height: 200px;
  width: 100%;
`;

const LeftSectionText = styled.p`
  font-size: 100px;
  font-weight: bold;
`;

const Banner = () => {
  return (
    <BannerRoot>
      <LeftSectionText>Introducing</LeftSectionText>
    </BannerRoot>
  );
};

export default Banner;
